export const Home = () => {
    const currentDate: number = Date.now();
    const today: Date = new Date(currentDate);

    return (
        <div> 
            <h1>Hello, Phumelele</h1>
            <h2>Today,
                 {today.getDate()} 
                 {today.getDay()} 
                 {today.getDate()}
                 {today.getMonth()}
                 {today.getFullYear()}
                  </h2>
        </div>
    );
}
